import Piscineiro from './imageWork/Front-piscineiro.png';
import Tecnico from './imageWork/itamarMaquinas.png';
import SpellBook from './imageWork/spellBook.png';

const ImagesWork = {
    "front-piscinas": Piscineiro, 
    "front-tecnico": Tecnico,
    "front-dndSpellApp": SpellBook,
};

export default ImagesWork
